import React from "react";
import { Container, Row, Col } from "react-bootstrap";

const Weather = () => {
  return (
    <Container>
      <Row className="py-3">
        <Col sm="3" xs="2" md="2">
          One
        </Col>

        <Col sm="9" xs="10" md="10">
          Tow
        </Col>
      </Row>
    </Container>
  );
};

export default Weather;
